/*
@cyan:         #35a766;
@blue:         #5977d3;
@purple:       #8100c6;
@green:        #8fad06;
@red:          #d24d4d;
@orange:       #cd8e21;
@light-orange: #e3a92d;
*/
.github-StagingView {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-StagingView-group {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-StagingView-header {
  display: flex;
  align-items: center;
  padding: 0 0 0 10px;
  font-weight: 600;
  border-top: 1px solid #e0dacc;
  border-bottom: 1px solid #e0dacc;
}
.github-StagingView-group:first-child .github-StagingView-header {
  border-top: none;
}
.github-StagingView-header .icon {
  text-align: center;
}
.github-StagingView-header .icon:before {
  color: #a6956d;
  margin-right: 8.33333333px;
  vertical-align: middle;
}
.github-StagingView-headerButton {
  height: 2.5em;
  border: none;
  padding: 0 10px;
  font-weight: normal;
  border-left: 1px solid #e0dacc;
  white-space: nowrap;
  background: none;
  cursor: default;
}
.github-StagingView-headerButton:disabled {
  color: #a6956d;
}
.github-StagingView-headerButton:active {
  background-color: #f7f6f2;
}
.github-StagingView-headerButton.icon:before {
  margin-right: 0;
  font-size: 1em;
  text-align: left;
}
.github-StagingView-headerButton--fullWidth {
  border-left: none;
  border-bottom: 1px solid #e0dacc;
}
.github-StagingView-title {
  flex: 1;
  margin-right: 10px;
  line-height: 2.5em;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.github-StagingView-list {
  flex: 1 1 0;
  overflow-x: auto;
}
.github-StagingView-group-truncatedMsg {
  padding: 5px 10px;
}
.github-StagingView-group.is-focused .is-selected {
  color: #000000;
  background: #e0dacc;
}
.github-StagingView:focus .github-StagingView-group.is-focused .is-selected {
  color: #000000;
  background: #cdb066;
}
